import React, { useState } from "react";
import styles from "./SearchResults.module.css";

const songs = [
  {
    songName: "Song1",
    songArtist: "Artist1",
    songAlbum: "Album1",
    songID: "id1",
  },
  {
    songName: "Song2",
    songArtist: "Artist2",
    songAlbum: "Album2",
    songID: "id2",
  },
  {
    songName: "Song3",
    songArtist: "Artist3",
    songAlbum: "Album3",
    songID: "id3",
  },
];

// const Song = songs.map((song) => (
//   <li key={songs.songID}>
//     <h2>{songs.songName}</h2>
//     <h3>
//       {songs.songArtist}
//       {songs.songAlbum}
//     </h3>
//   </li>
// ));

const Song = ({ songName, songArtist, songAlbum, songID }) => (
  <li key={songID}>
    <h2>{songName}</h2>
    <h3>
      {songArtist}
      {songAlbum}
    </h3>
  </li>
);

export default function SearchResults() {
  return (
    <div
      className="SearchResults-header"
      style={{ border: "1px solid black", marginRight: "2em" }}
    >
      <h1>Results</h1>
      <div style={{ border: "1px solid black", marginRight: "2em" }}>
        <ul>{songs.map(Song)}</ul>
        <div className={styles.btntest}>
          <button>Add</button>
        </div>
      </div>
    </div>
  );
}
